import styled from 'styled-components/macro'

export const CardContainer = styled.section`
  width: 40%;
  display: flex;
  flex-direction: row;
  align-items: center;
  margin: 0 20px;
`

export const Card = styled.section`
  width: 40%;
  display: flex;
  flex-direction: row;
  align-items: center;
  margin: 0 20px;
`
